import React from 'react'
import './Navbar.css'
import logogarona from '../../img/logogarona.png';
import "./Script";
import "./MenuItems";
import '../Divorce/Divorce';
import { Link } from 'react-router-dom'; 

function Navbar() {
  return (
    <nav className='n-wrapper'>
        <div className="n-left">  {/*//创建左边导航栏  */}
            <div className='n-name'> <img src={logogarona} alt="garonalogo"/> <span>toggle</span> {/* span是行内元素，等下添加切换按钮 */}</div>

        </div>
        <div className="n-right"> {/* //创建右边导航栏 */}
            <div className="n-list">
                <ul className="nav-menu" style={{listStyleType:'none'}}> {/* ul是无序列表 */}
                    <li className='n-home'>
                    <Link  className="nav_link" to="/Home">Home</Link>
                        </li>   {/* 无序列表里面有每个列表 */}
                    <li className='n-penal'>
                    <Link  className="nav_link" to="/Penal">Penal</Link>
                    </li>
                    <li className='n-divorce'>
                        <Link  className="nav_link" to="/Divorce">Divorce</Link>
                        {/* <a className='nav_link' href="../Divorce/Divorce.js">divorce</a> */}
                        </li>
                    <li className='n-civil'>
                        <a className='nav_link' href="/public/Navpages/civil.html">civil</a>
                        </li>
                    <li className='n-internacional'>
                        <a className='nav_link' href="/public/Navpages/internacional.html">internacional</a>
                    </li>
                    <li className='n-mercantil'>
                        <a className='nav_link' href="/public/Navpages/mercantil.html">mercantil</a>
                        </li>
                    <li className='n-despacho'>
                        <a className='nav_link' href="/public/Navpages/despacho.html">despacho</a>
                        </li> {/* 等下记得在这个列表下再添加一个下拉菜单 */}
                    <li className='n-contacto'>
                        <a className='nav_link' href="/">contacto</a>
                        </li>
                </ul>
            </div>

            <button className='Button n-button'>
                Contect US
            </button>



        </div>
    </nav>
  )
}

export default Navbar;
